import React from 'react';
import UnderHeader from "../componets/main/under_header";
import News from "../componets/main/news";
import NewsPartner from "../componets/main/news_partner";
const Main = () => {
    return (
        <>
            <UnderHeader/>
            <News/>
            <NewsPartner/>
        </>
    );
};

export default Main;
